drop database if exists QLTINHTHANHVIETNAM;
create database QLTINHTHANHVIETNAM;

-- TABLE -------------------------------------------------------------------------------------------------
create table QLTINHTHANHVIETNAM.TINH
(
	maTinh varchar (10) not null primary key,
	tenTinh varchar (100)
);

create table QLTINHTHANHVIETNAM.QUANHUYEN
(
	maQH varchar (10) not null primary key,
	tenQH varchar (100),
	maTinh varchar (10) not null,
	constraint fk_QH_T foreign key (maTinh) references TINH (maTinh)
);

create table QLTINHTHANHVIETNAM.XAPHUONG
(
	maXP int auto_increment not null primary key,
	tenXP varchar (100),
	maQH varchar (10) not null,
	constraint fk_XP_QH foreign key (maQH) references QUANHUYEN (maQH)
);

-- DATA --------------------------------------------------------------------------------------------------
