-- PROCEDURE ---------------------------------------------------------------------------------------------
-- Hiển thị tỉnh thành -----------------------------------------------------------------------------------
DELIMITER $$
create procedure qltinhthanhvietnam.showTinh()
begin
	select *
    from qltinhthanhvietnam.tinh;
end$$
DELIMITER ;

call qltinhthanhvietnam.showTinh();

-- Hiển thị quận huyện theo tỉnh thành -------------------------------------------------------------------
DELIMITER $$
create procedure qltinhthanhvietnam.showQHuyen(in tenTinhIn varchar(100))
begin
	select tenQH
    from qltinhthanhvietnam.quanhuyen, qltinhthanhvietnam.tinh
    where qltinhthanhvietnam.tinh.maTinh = qltinhthanhvietnam.quanhuyen.maTinh and 
		  qltinhthanhvietnam.tinh.tenTinh = tenTinhIn;
end$$
DELIMITER ;

call qltinhthanhvietnam.showQHuyen('TP. Hồ Chí Minh');

-- Hiển thị xã phường theo quận huyện --------------------------------------------------------------------
DELIMITER $$
create procedure qltinhthanhvietnam.showXPhuong(in tenQHuyenIn varchar(100))
begin
	select tenXP
    from qltinhthanhvietnam.xaphuong, qltinhthanhvietnam.quanhuyen, qltinhthanhvietnam.tinh
    where qltinhthanhvietnam.tinh.maTinh = qltinhthanhvietnam.quanhuyen.maTinh and
		  qltinhthanhvietnam.quanhuyen.maQH = qltinhthanhvietnam.xaphuong.maQH and
          qltinhthanhvietnam.quanhuyen.tenQH = tenQHuyenIn;
end$$
DELIMITER ;

call qltinhthanhvietnam.showXPhuong('Quận 1');

-- Đếm tổng số lượng đơn vị hành chính của quận huyện ----------------------------------------------------
DELIMITER $$
create procedure qltinhthanhvietnam.countXPTTran(in tenQHuyenIn varchar(100))
begin
	select count(*)
    from qltinhthanhvietnam.tinh, qltinhthanhvietnam.quanhuyen, qltinhthanhvietnam.xaphuong
    where qltinhthanhvietnam.tinh.maTinh = qltinhthanhvietnam.quanhuyen.maTinh and
		  qltinhthanhvietnam.quanhuyen.maQH = qltinhthanhvietnam.xaphuong.maQH and
          qltinhthanhvietnam.quanhuyen.tenQH = tenQHuyenIn;
end$$
DELIMITER ;

call qltinhthanhvietnam.countXPTTran('Huyện Bình Chánh');

-- Đếm số lượng thị trấn của quận huyện ------------------------------------------------------------------
DELIMITER $$
create procedure qltinhthanhvietnam.countTTran(in tenQHuyenIn varchar(100))
begin
	select count(*)
    from qltinhthanhvietnam.tinh, qltinhthanhvietnam.quanhuyen, qltinhthanhvietnam.xaphuong
    where qltinhthanhvietnam.tinh.maTinh = qltinhthanhvietnam.quanhuyen.maTinh and
		  qltinhthanhvietnam.quanhuyen.maQH = qltinhthanhvietnam.xaphuong.maQH and
          qltinhthanhvietnam.quanhuyen.tenQH = tenQHuyenIn and 
          qltinhthanhvietnam.xaphuong.tenXP like 'Thị trấn%';
end$$
DELIMITER ;

call qltinhthanhvietnam.countTTran('Huyện Bình Chánh');

-- Đếm số lượng xã của quận huyện ------------------------------------------------------------------------
DELIMITER $$
create procedure qltinhthanhvietnam.countXa(in tenQHuyenIn varchar(100))
begin
	select count(*)
    from qltinhthanhvietnam.tinh, qltinhthanhvietnam.quanhuyen, qltinhthanhvietnam.xaphuong
    where qltinhthanhvietnam.tinh.maTinh = qltinhthanhvietnam.quanhuyen.maTinh and
		  qltinhthanhvietnam.quanhuyen.maQH = qltinhthanhvietnam.xaphuong.maQH and
          qltinhthanhvietnam.quanhuyen.tenQH = tenQHuyenIn and
          qltinhthanhvietnam.xaphuong.tenXP like 'Xã%';
end$$
DELIMITER ;

call qltinhthanhvietnam.countXa('Quận 1');

-- Đếm số lượng phường của quận huyện --------------------------------------------------------------------
DELIMITER $$
create procedure qltinhthanhvietnam.countPhuong(in tenQHuyenIn varchar(100))
begin
	select count(*)
    from qltinhthanhvietnam.tinh, qltinhthanhvietnam.quanhuyen, qltinhthanhvietnam.xaphuong
    where qltinhthanhvietnam.tinh.maTinh = qltinhthanhvietnam.quanhuyen.maTinh and
		  qltinhthanhvietnam.quanhuyen.maQH = qltinhthanhvietnam.xaphuong.maQH and
          qltinhthanhvietnam.quanhuyen.tenQH = tenQHuyenIn and
          qltinhthanhvietnam.xaphuong.tenXP like 'Phường%';
end$$
DELIMITER ;

call qltinhthanhvietnam.countPhuong('Quận 1');